import { Button } from '@mui/material';
import React, { useState } from 'react'

function B(props) {
    const [count, setCount]=useState(0)
    function increment(){
        setCount(count+1);
    }
    return(
        <div>
            <Button variant="contained" onMouseOver={increment}>B {count} Times Hovered</Button>
        </div>
    );
}
export default B;
